      subroutine getoptical69(E,refl,absl,rind,plsh,eff)
      implicit none
      real E,refl,absl,rind,plsh,eff
      integer n
      real x
      integer nbins
      real Ephot(36)
      real abslen(36)
      real effic(36)
      real rindex(36)
      real smooth(36)
      real refloss(36)
      common /optical69/nbins,Ephot,rindex,abslen,refloss,smooth,effic
      do n=1,nbins
        if (E.lt.Ephot(n)) go to 10
      enddo
   10 continue
      if (n.eq.1.or.n.gt.nbins) then
        refl = 0
        absl = 0
        rind = 0
        plsh = 1
        eff = 0
